import React, {Component} from 'react'
import axios from '../axios'
import './Table.css'

export default class Table2 extends Component {
    constructor(props) {
        super(props);
        this.state = {
            Users: []
        };
    }
    getUsersData() {
        axios
            .get(`http://localhost:5000/view`, {})
            .then(res => {
                const data = res.data
                console.log(data)
                const users = data.map(u =>
                    <div ><table> 
                        {/* <tr><th><h1>Name</h1></th></tr> */}
                        <tr>
                        <th>Name{u.name}</th>
                        <th>{u.email}</th>
                        <th>{u.work}</th>
                        <th>{u.btech}</th>
                        <th>{u.score}</th>
                        <th>{u.twel}</th>
                        <th>{u.tenth}</th>
                        </tr>                        </table>

                    </div>
                    )

                    this.setState({
                        users
                    })

            })
            .catch((error) => {
                console.log(error)
            })

    }
    componentDidMount(){
        this.getUsersData()
    }
    render() {

        return (
            <div >
                <table className="work">
                    <tr><th>Name</th></tr>
                </table>
               <p> {this.state.users}</p> 
            </div>
        )
    }
}
